import Constants from 'expo-constants';
import { GoogleGenAI, FunctionCallingConfigMode, FunctionDeclaration, Type, Content, FunctionResponse, ContentUnion, createModelContent, createPartFromFunctionResponse, ContentListUnion } from "@google/genai";

class Agent {
  genAI: GoogleGenAI
  history: Content[] = []
  constructor(apiKey: string = Constants.expoConfig?.extra?.apiKey) {
    this.genAI = new GoogleGenAI({ apiKey })
  }

  async call(content: Content[] | Content): Promise<ContentUnion> {
    if (Array.isArray(content)) {
      this.history.push(...content)
    } else {
      this.history.push(content)
    }
    const response = await this.genAI.models.generateContent({
      model: 'gemini-2.0-flash-001',
      contents: this.history,
      config: {
        toolConfig: {
          functionCallingConfig: {
            mode: FunctionCallingConfigMode.AUTO,
            allowedFunctionNames: ['createImage']
          }
        },
        tools: [{ functionDeclarations: tools }]
      }
    })


    if (response.candidates && response.candidates.length > 0 && response.candidates[0].content)
      this.history.push(response.candidates[0].content)

    if (response.functionCalls) {
      if (response.functionCalls[0].name === 'makeImage') {
        if (response.functionCalls[0].args) {
          let res = makeImage(response.functionCalls[0].args[0] as string)
          let fc = new FunctionResponse()
          fc.name = 'createImage'
          fc.id = response.functionCalls[0].id
          fc.response = {
            output: res,
          }
          if (response.functionCalls[0].id) {
            let c = createModelContent(createPartFromFunctionResponse("createImage", response.functionCalls[0].id, { output: res }))
            await this.call(c)
          }
        }
      }
    }
    if (response.candidates && response.candidates.length > 0 && response.candidates[0].content) {
      return this.history[this.history.length - 1]
    }
    else
      throw Error("No response from agent")


  }
}

const tools: FunctionDeclaration[] = [
  {
    name: 'makeImage',
    description: 'Create an base64 image from a prompt',
    parameters: {
      type: Type.STRING,
      description: 'Prompt that describe image you want to create'
    },
  }
]

function makeImage(prompt: string): string {
  return "data:image/jpeg;base64,"
}


